BEGIN TRANSACTION;
DROP TABLE IF EXISTS "city";
CREATE TABLE IF NOT EXISTS "city" (
	"cityid"	INTEGER,
	"name"	TEXT,
	"gps_left_lat"	REAL,
	"gps_left_lon"	REAL,
	"gps_right_lat"	REAL,
	"gps_right_lon"	REAL,
	PRIMARY KEY("cityid" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "station";
CREATE TABLE IF NOT EXISTS "station" (
	"stationid"	INTEGER,
	"type"	TEXT,
	"address"	TEXT,
	"cityid"	INTEGER,
	"gps_lat"	REAL,
	"gps_lon"	REAL,
	PRIMARY KEY("stationid" AUTOINCREMENT),
	FOREIGN KEY("cityid") REFERENCES "city"("cityid")
);
DROP TABLE IF EXISTS "log";
CREATE TABLE IF NOT EXISTS "log" (
	"id"	INTEGER,
	"event"	TEXT,
	"when"	BLOB,
	"error_msg"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "staff";
CREATE TABLE IF NOT EXISTS "staff" (
	"staffid"	INTEGER,
	"firstname"	TEXT,
	"lastname"	TEXT,
	"password"	TEXT,
	"role"	TEXT,
	"email"	TEXT UNIQUE,
	PRIMARY KEY("staffid" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "travel_history";
CREATE TABLE IF NOT EXISTS "travel_history" (
	"travelid"	INTEGER,
	"date_start"	DATETIME DEFAULT current_timestamp,
	"date_end"	DATETIME,
	"travel_time"	REAL,
	"bikeid"	INTEGER,
	"userid"	INTEGER,
	"price"	REAL,
	"gps_lat_start"	REAL,
	"gps_lon_start"	REAL,
	"gps_lat_end"	REAL,
	"gps_lon_end"	REAL,
	FOREIGN KEY("bikeid") REFERENCES "bike"("bikeid"),
	FOREIGN KEY("userid") REFERENCES "customer"("userid"),
	PRIMARY KEY("travelid" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "customer";
CREATE TABLE IF NOT EXISTS "customer" (
	"userid"	INTEGER,
	"firstname"	TEXT,
	"lastname"	TEXT,
	"password"	TEXT,
	"email"	TEXT UNIQUE,
	"cityid"	INTEGER,
	"payment"	TEXT,
	"balance"	NUMERIC,
	FOREIGN KEY("cityid") REFERENCES "city"("cityid"),
	PRIMARY KEY("userid" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "bike";
CREATE TABLE IF NOT EXISTS "bike" (
	"bikeid"	INTEGER,
	"name"	TEXT,
	"image"	TEXT,
	"description"	TEXT,
	"max_speed"	INTEGER,
	"battery_capacity"	REAL DEFAULT 5000,
	"status"	TEXT DEFAULT 'vacant',
	"battery_level"	NUMERIC DEFAULT 5000,
	"gps_lat"	REAL,
	"gps_lon"	REAL,
	"dest_lat"	REAL,
	"dest_lon"	REAL,
	"stationid"	INTEGER DEFAULT -1,
	"cityid"	INTEGER,
	FOREIGN KEY("cityid") REFERENCES "city"("cityid"),
	FOREIGN KEY("stationid") REFERENCES "station"("stationid"),
	PRIMARY KEY("bikeid" AUTOINCREMENT)
);
COMMIT;
